import React, { Component } from "react";

class Features extends Component {
  state = {
    count: 0,
    yearBuilt: 1969,
    taxAmount: 4542.86,
    noOfBathrooms: 2,
    noOfBedrooms: 3,
    area: 1476,
  };

  render() {
    return (
      <React.Fragment className="bg-primary">
        <div
          style={{
            fontSize: 40,
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
          className="bg-primary text-white"
        >
          House Price Predictor
        </div>
        <input type="text" placeholder="Tax Amount" className="m-3" />
        <input type="text" placeholder="Number of Bathrooms" className="m-3" />
        <input type="text" placeholder="Number of Bedrooms" className="m-3" />
        <input type="text" placeholder="Year Built" className="m-3" />
        <input type="text" placeholder="Area" className="m-3" />
      </React.Fragment>
    );
  }
}

export default Features;
